import React, {useState} from 'react';
import {StateContext} from '../component/stateContext'


export default function Login(){
    const [users, setUsers] = useState(StateContext);

    function GetUser(e){
        const result = e.target.value;
        const user = users.filter(user => user === result);
        console.log(user);
    }
    return (
        <form >
            <label>Login</label>
            <input type='text' onChange={GetUser} />
            <button>Submit</button>
        </form>
    );
}
